import React from "react";
import Nav from"./Nav"
class Info extends React.Component {

    infopanel(props) {
        if (this.props.panel == "home") {
            return (
                <div>
                    <h2> Сервис </h2>
                    <p> Книжка волонтера </p>
                </div>
            )
        }
        else{
            return (
                <div>
                    <h2> Гавно </h2>
                    <p> С мочой </p>
                </div>
            )
        }
    }
    render(){
        return(
            <div>
                {this.infopanel()}
            </div>
        );
    }
}
export default Info;
